※6枚までネコポス発送で送料無料キャンペーンについてのご注意<BR>
ネコポス（ヤマト運輸メール便）発送で送料無料キャンペーン対応とさせていただきます、宅配便・代引きおよび日時ご指定には対応できません。<BR>
宅配便を選択された場合は別途宅配便送料がかかります、受注確認後、当店にて送料をプラスした価格に訂正させていただきますのでご注意ください。<BR><BR>
●素材：掌…＞ソフトカブレッタレザー（天然羊革）　甲（マイクロファイバー合成皮革）<BR>
●本製品の手のひら部分は天然の羊の革を使用しております、個体により若干のシミ・キズ等がございますがご使用感に問題はございません、予めご了承ください。<BR>
●仕上げ：グリッター仕上げ（ラメ））※カモフラージュは除く<BR>
●カラー：全16色
Ocean Blue（オーシャンブルー）　Orange（オレンジ）　Lime（ライム）　Grape（グレープ）　Navy Blue（ネイビーブルー）　Yellow（イエロー） Dark Gray（ダークグレー）　Silver（シルバー）　Gold（ゴールド）　Pink（ピンク）　Red Camo（レッドカモ）　Blue Camo（ブルーカモ）　Green Camo（グリーンカモ）　Lime Yellow（ライムイエロー）　Pure White（ピュアホワイト）　Deep Black（ディープブラック）<BR>
●サイズ：S（22ｃｍ～23ｃｍ）　M（23ｃｍ～24ｃｍ）　L（24ｃｍ～25ｃｍ）　XL（25ｃｍ～26ｃｍ）<BR>
※ご使用にあたってのご注意：雨天時等ごくまれにカラー部分が衣類等に移行する場合がございますのでお気を付けください。<BR>
